let currentDate = new Date();

// Створюємо об'єкт опцій для форматування
let options = {
    year: 'numeric',
    month: '2-digit',
    day: '2-digit',
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit',
    timeZone: 'Europe/Kiev',
};

// Отримуємо форматовану поточну дату
let formattedDate = currentDate.toLocaleDateString('uk-UA', options);

// Додаємо 3 дні до поточної дати
let datePlus3Days = new Date(currentDate);
datePlus3Days.setDate(currentDate.getDate() + 3);

